import React from 'react'
import Typist from 'react-typist'
import './App.css';
import NameBox from './components/NameBox'

const App = () => {

  const links = [
    {
      label: 'LinkedIn',
      url: 'https://www.linkedin.com/in/kyle-gloria/',
      image: 'https://www.iconninja.com/files/479/390/409/linkedin-icon.png',
      id: '1'
    },
    {
      label: 'GitHub',
      url: 'https://github.com/KGloria',
      image: 'https://www.iconninja.com/files/930/277/269/github-icon.png',
      id: '2'
    }
  ] 

  return (
    <>
      {/* Icon Overlay */}
      <div className='Icon-Overlay'>
          <div style={{position: 'absolute', left: '0%', top: '40%', right: '0%' }}>
            {links.map(link => 
              <a href={link.url} key={link.id}>
                <img className='Icon-Image' src={link.image} alt={link.label}/>
              </a>
            )}
          </div>
      </div>

      <div className="App">

        <header className="App-header"> 
            <NameBox word="Kyle Gloria"/>
            <p className='LandingPage-Desc'>Full Stack Developer | IT Professional</p>

          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn More
          </a>
        </header>
      </div>
    </>
  );
}

export default App;
